  Component 
} 
from 'react';

import {
  Button,
  Grid,
  Row,
  Column,
  Range
}
from "./components";

class App extends Component {
  render() {
    return (
      <Row>
        <Column>
          <Grid>
            <Button name="q"/>
            <Button name="w"/>
            <Button name="e"/>

            <Button name="a"/>
            <Button name="s"/>
            <Button name="d"/>

            <Button name="z"/>
            <Button name="x"/>
            <Button name="c"/>
          </Grid>
        </Column>

        <Column>
          <Grid columns={1}>
            <Range/>
          </Grid>
        </Column>
      </Row>
    );
  }
}

export default App;
